import React from "react";
import "./styles/Item.css";
import "./styles/ItemList.css";

class Item extends React.Component {
  render() {
    return (
      <div className="Item">
        <div className="row">

        </div>
          <div className="col-3 Item__Circulo">
            <div className="Item__Circulo--forma"> </div>
          </div>
          <div className="col- 8 Item__Info">
            <p className="Item__Name"> {this.props.info.sequence} </p>
            <p className="Item__Creado">Creado en: </p>
          </div>

          <div className="col-12 Item__Muta"> {this.props.info.mutation} </div>
        </div>

    );
  }
}

class ItemList extends React.Component {
  render() {
    return (
      <div className="row">

          {this.props.items.map(item => {
            return (
              <div className="col-4">
                <Item info= {item}/>
              </div>
            );
          })}
      </div>
    );
  }
}

export default ItemList;
